        </li>
        <li>
          <Link to="/projects">Portfolio</Link>
        </li>
        <li>
          <Link to="/contact">Contact</Link>
        </li>
        <li>
          <Link to="/Resume">Resume</Link>
        </li>
      </ul>
    </div>
  );
};

export default Nav;
